let INSTAGRAM_APP_ID = 936619743392459;

async function GetHashtagPostsSectionOtherCall(hashtagName, nextPageToken, pageNumber) {
  let baseURL = "https://i.instagram.com/api/v1/tags/"+hashtagName+"/sections/";
  let u = await getMainUser();
  let csrfToken = u.csrfToken

  let headers = {
    "x-ig-app-id": INSTAGRAM_APP_ID,
    "x-csrftoken": csrfToken,
    "content-type": "application/x-www-form-urlencoded",
  };

  let bd = {
    include_persistent: 0,
    max_id: nextPageToken,
    page: pageNumber,
    surface: 'grid',
    tab: 'recent'
  }



  let response;
  try {
    if (process.env.NODE_ENV !== "development") {
      response = await PostRequest(baseURL, qs.stringify(bd), headers);
    } else {
      response = await getDummyHashtagResopnse();
    }
  } catch (e) {
    NewNotification("Pausing for 3 Minutes and trying again. Don't close the process. Also check if your IG Account is still working.")
    return {
      users: [], nextPageToken: null, pageNumber: 1, moreAvailable: false, retry: true
    }
  }
  if (!response.data) {
    return {
      users: [], nextPageToken: null, pageNumber: 1, moreAvailable: false
    };
  }

  let body = response.data;

  let users = getPostsFromHashtags(body);
  let newNextPageToken = getNextPageTokenFromHashtags(body);
  let newPageNumber = getPageNumberFromHashtags(body);
  let moreAvailable = getMoreAvailableFromHashtags(body);

  return {
    users: users, nextPageToken: newNextPageToken, pageNumber: newPageNumber, moreAvailable: moreAvailable
  };
}

function getPostsFromHashtags(body) {
  let recent_sections = body["sections"]
  return getUsersFromSections(recent_sections)
}

function getUsersFromSections(sections) {
  let users = [];
  sections.map(s => {
    let medias;
    if (s.layout_type === "media_grid") {
      medias = s['layout_content']['medias']
    } else {
      medias = s['layout_content']['fill_items']
    }
    medias.map(m1 => {
      let m = m1.media;
      let user = m.user;
      users.push({
        ig_id: user.pk,
        username: user['username'],
        shortcode: m['code'],
        taken_at: m['taken_at']
      })
    })
  })
  return users;
}

function getNextPageTokenFromHashtags(body) {
  return body["next_max_id"]
}

function getPageNumberFromHashtags(body) {
  return body["next_page"]
}

function getMoreAvailableFromHashtags(body) {
  return body["more_available"]
}



